import{_ as t,c as e,o as a,a as s}from"./app.4f55a2aa.js";const i="/performance/optimization/2.avif",r="/performance/optimization/3.avif",g=JSON.parse('{"title":"RAIL\u6027\u80FD\u6A21\u578B","description":"","frontmatter":{},"headers":[{"level":2,"title":"\u54CD\u5E94","slug":"\u54CD\u5E94","link":"#\u54CD\u5E94","children":[]},{"level":2,"title":"\u52A8\u753B","slug":"\u52A8\u753B","link":"#\u52A8\u753B","children":[]},{"level":2,"title":"\u7A7A\u95F2","slug":"\u7A7A\u95F2","link":"#\u7A7A\u95F2","children":[]},{"level":2,"title":"\u52A0\u8F7D","slug":"\u52A0\u8F7D","link":"#\u52A0\u8F7D","children":[]}],"relativePath":"optimization/metrics/rail.md","lastUpdated":1670172988000}'),d={name:"optimization/metrics/rail.md"},l=s('<h1 id="rail\u6027\u80FD\u6A21\u578B" tabindex="-1">RAIL\u6027\u80FD\u6A21\u578B <a class="header-anchor" href="#rail\u6027\u80FD\u6A21\u578B" aria-hidden="true">#</a></h1><p>RAIL \u662F Response, Animation, Idle, \u548C Load \u7684\u9996\u5B57\u6BCD\u7F29\u5199, \u662F\u4E00\u79CD\u7531 Google Chrome \u56E2\u961F\u4E8E 2015 \u5E74\u63D0\u51FA\u7684\u6027\u80FD\u6A21\u578B, \u7528\u4E8E\u63D0\u5347\u6D4F\u89C8\u5668\u5185\u7684\u7528\u6237\u4F53\u9A8C\u548C\u6027\u80FD\u3002</p><p>RAIL \u6A21\u578B\u7684\u7406\u5FF5\u662F\u201D\u4EE5\u7528\u6237\u4E3A\u4E2D\u5FC3\uFF0C\u6700\u7EC8\u76EE\u6807\u4E0D\u662F\u8BA9\u60A8\u7684\u7F51\u7AD9\u5728\u4EFB\u4F55\u7279\u5B9A\u8BBE\u5907\u4E0A\u90FD\u80FD\u8FD0\u884C\u5F88\u5FEB\uFF0C\u800C\u662F\u4F7F\u7528\u6237\u6EE1\u610F\u201D\u3002 <img src="'+i+'" alt=""></p><p>\u8FD9\u4E2A\u540D\u5B57\u7684\u7531\u6765\u662F\u56DB\u4E2A\u82F1\u6587\u5355\u8BCD\u7684\u9996\u5B57\u6BCD\uFF1A</p><ul><li>\u54CD\u5E94\uFF08Response\uFF09\uFF1A\u5E94\u8BE5\u5C3D\u53EF\u80FD\u5FEB\u901F\u7684\u54CD\u5E94\u7528\u6237, \u5E94\u8BE5\u5728 100ms \u4EE5\u5185\u54CD\u5E94\u7528\u6237\u8F93\u5165\u3002</li><li>\u52A8\u753B\uFF08Animation\uFF09\uFF1A\u5728\u5C55\u793A\u52A8\u753B\u7684\u65F6\u5019\uFF0C\u6BCF\u4E00\u5E27\u5E94\u8BE5\u4EE5 16ms \u8FDB\u884C\u6E32\u67D3\uFF0C\u8FD9\u6837\u53EF\u4EE5\u4FDD\u6301\u52A8\u753B\u6548\u679C\u7684\u4E00\u81F4\u6027\uFF0C\u5E76\u4E14\u907F\u514D\u5361\u987F\u3002</li><li>\u7A7A\u95F2\uFF08Idle\uFF09\uFF1A\u5F53\u4F7F\u7528 Javascript \u4E3B\u7EBF\u7A0B\u7684\u65F6\u5019\uFF0C\u5E94\u8BE5\u628A\u4EFB\u52A1\u5212\u5206\u5230\u6267\u884C\u65F6\u95F4\u5C0F\u4E8E 50ms \u7684\u7247\u6BB5\u4E2D\u53BB\uFF0C\u8FD9\u6837\u53EF\u4EE5\u91CA\u653E\u7EBF\u7A0B\u4EE5\u8FDB\u884C\u7528\u6237\u4EA4\u4E92\u3002</li><li>\u52A0\u8F7D\uFF08Load\uFF09\uFF1A\u5E94\u8BE5\u5728\u5C0F\u4E8E 1s \u7684\u65F6\u95F4\u5185\u52A0\u8F7D\u5B8C\u6210\u4F60\u7684\u7F51\u7AD9\uFF0C\u5E76\u53EF\u4EE5\u8FDB\u884C\u7528\u6237\u4EA4\u4E92\u3002</li></ul><blockquote><p>\u6839\u636E\u7F51\u7EDC\u6761\u4EF6\u548C\u786C\u4EF6\u7684\u4E0D\u540C\uFF0C\u7528\u6237\u5BF9\u6027\u80FD\u5EF6\u8FDF\u7684\u7406\u89E3\u4E5F\u6709\u6240\u4E0D\u540C\u3002\u4F8B\u5982\uFF0C\u901A\u8FC7\u5FEB\u901F\u7684Wi-Fi\u8FDE\u63A5\u5728\u529F\u80FD\u5F3A\u5927\u7684\u53F0\u5F0F\u673A\u4E0A\u52A0\u8F7D\u7AD9\u70B9\u901A\u5E38\u57281\u79D2\u5185\u5B8C\u6210\uFF0C\u7528\u6237\u5BF9\u6B64\u5DF2\u7ECF\u4E60\u4EE5\u4E3A\u5E38\u3002\u57283G\u8FDE\u63A5\u901F\u5EA6\u8F83\u6162\u7684\u79FB\u52A8\u8BBE\u5907\u4E0A\u52A0\u8F7D\u7F51\u7AD9\u9700\u8981\u82B1\u8D39\u66F4\u591A\u65F6\u95F4\uFF0C\u56E0\u6B64\u79FB\u52A8\u7528\u6237\u901A\u5E38\u66F4\u8010\u5FC3\uFF0C\u5728\u79FB\u52A8\u8BBE\u5907\u4E0A\u52A0\u8F7D5 s\u662F\u4E00\u4E2A\u66F4\u73B0\u5B9E\u7684\u76EE\u6807\u3002</p></blockquote><p>\u8FD9\u56DB\u4E2A\u5355\u8BCD\u4EE3\u8868\u4E0E\u7F51\u7AD9\u6216\u5E94\u7528\u7684\u751F\u547D\u5468\u671F\u76F8\u5173\u7684\u56DB\u4E2A\u65B9\u9762\uFF0C\u8FD9\u4E9B\u65B9\u9762\u4F1A\u4EE5\u4E0D\u540C\u7684\u65B9\u5F0F\u5F71\u54CD\u6574\u4E2A\u7F51\u7AD9\u7684\u6027\u80FD\u3002</p><p>\u6211\u4EEC\u5C06\u7528\u6237\u4F5C\u4E3A\u4E4B\u540E\u6027\u80FD\u4F18\u5316\u7684\u4E2D\u5FC3\uFF0C\u9996\u5148\u9700\u8981\u4E86\u89E3\u7528\u6237\u5BF9\u4E8E\u5EF6\u8FDF\u7684\u53CD\u5E94\u3002\u7528\u6237\u611F\u77E5\u5EF6\u8FDF\u7684\u65F6\u95F4\u7A97\u53E3\uFF0C\u5982\u4E0B\u8868\u6240\u793A\u3002</p><table><thead><tr><th>\u5EF6\u8FDF</th><th>\u7528\u6237\u53CD\u6620</th></tr></thead><tbody><tr><td>0 ~ 16ms</td><td>\u4EBA\u773C\u53EF\u4EE5\u611F\u77E5\u6BCF\u79D2 60 \u5E27\u7684\u52A8\u753B\uFF0C\u5373\u6BCF\u5E27 16 ms\uFF0C\u9664\u4E86\u6D4F\u89C8\u5668\u5C06\u4E00\u5E27\u753B\u9762\u7ED8\u5236\u5230\u5C4F\u5E55\u4E0A\u7684\u65F6\u95F4\uFF0C\u7F51\u7AD9\u5E94\u7528\u5927\u7EA6\u9700\u8981 10ms \u6765\u751F\u6210\u4E00\u5E27</td></tr><tr><td>0 ~ 100ms</td><td>\u5728\u8BE5\u65F6\u95F4\u8303\u56F4\u5185\u54CD\u5E94\u7528\u6237\u64CD\u4F5C\uFF0C\u624D\u4F1A\u662F\u6D41\u7545\u7684\u4F53\u9A8C</td></tr><tr><td>100 ~ 1000ms</td><td>\u80FD\u591F\u611F\u89C9\u5230\u660E\u663E\u7684\u5EF6\u8FDF</td></tr><tr><td>&gt;1s</td><td>\u7528\u6237\u7684\u6CE8\u610F\u529B\u5C06\u79BB\u5F00\u5BF9\u6267\u884C\u4EFB\u52A1\u7684\u5173\u6CE8</td></tr><tr><td>&gt;10s</td><td>\u7528\u6237\u611F\u5230\u5931\u671B\uFF0C\u53EF\u80FD\u4F1A\u653E\u5F03\u4EFB\u52A1</td></tr></tbody></table><h2 id="\u54CD\u5E94" tabindex="-1">\u54CD\u5E94 <a class="header-anchor" href="#\u54CD\u5E94" aria-hidden="true">#</a></h2><p>\u6307\u6807\uFF1A\u5E94\u8BE5\u5C3D\u53EF\u80FD\u5FEB\u901F\u7684\u54CD\u5E94\u7528\u6237\uFF0C\u5E94\u8BE5\u5728 100ms \u4EE5\u5185\u54CD\u5E94\u7528\u6237\u8F93\u5165\uFF0C\u5904\u7406\u4E8B\u4EF6\u5E94\u572850ms\u4EE5\u5185\u5B8C\u6210\u3002</p><p>\u7F51\u7AD9\u6027\u80FD\u5BF9\u4E8E\u54CD\u5E94\u65B9\u9762\u7684\u8981\u6C42\u662F\uFF0C\u5728\u7528\u6237\u611F\u77E5\u5EF6\u8FDF\u4E4B\u524D\u63A5\u6536\u5230\u64CD\u4F5C\u7684\u53CD\u9988\u3002\u6BD4\u5982\u7528\u6237\u8FDB\u884C\u4E86\u6587\u672C\u8F93\u5165\u3001\u6309\u94AE\u5355\u51FB\u3001\u8868\u5355\u5207\u6362\u53CA\u542F\u52A8\u52A8\u753B\u7B49\u64CD\u4F5C\u540E\uFF0C\u5FC5\u987B\u5728 100ms \u5185\u6536\u5230\u53CD\u9988\uFF0C\u5982\u679C\u8D85\u8FC7 100ms \u7684\u65F6\u95F4\u7A97\u53E3\uFF0C\u7528\u6237\u5C31\u4F1A\u611F\u77E5\u5EF6\u8FDF\u3002</p><p>\u770B\u4F3C\u5F88\u57FA\u672C\u7684\u7528\u6237\u64CD\u4F5C\u80CC\u540E\uFF0C\u53EF\u80FD\u4F1A\u9690\u85CF\u7740\u590D\u6742\u7684\u4E1A\u52A1\u903B\u8F91\u5904\u7406\u53CA\u7F51\u7EDC\u8BF7\u6C42\u4E0E\u6570\u636E\u8BA1\u7B97\u3002\u5BF9\u6B64\u6211\u4EEC\u5E94\u5F53\u8C28\u614E\uFF0C\u5C06\u8F83\u5927\u5F00\u9500\u7684\u5DE5\u4F5C\u653E\u5728\u540E\u53F0\u5F02\u6B65\u6267\u884C\uFF0C\u800C\u5373\u4FBF\u540E\u53F0\u5904\u7406\u8981\u6570\u767E\u6BEB\u79D2\u624D\u80FD\u5B8C\u6210\u7684\u64CD\u4F5C\uFF0C\u4E5F\u5E94\u5F53\u7ED9\u7528\u6237\u63D0\u4F9B\u53CA\u65F6\u7684\u9636\u6BB5\u6027\u53CD\u9988\u3002</p><p>\u6BD4\u5982\u5728\u5355\u51FB\u6309\u94AE\u5411\u540E\u53F0\u53D1\u8D77\u67D0\u9879\u4E1A\u52A1\u5904\u7406\u8BF7\u6C42\u65F6\uFF0C\u9996\u5148\u53CD\u9988\u7ED9\u7528\u6237\u5F00\u59CB\u5904\u7406\u7684\u63D0\u793A\uFF0C\u7136\u540E\u5728\u5904\u7406\u5B8C\u6210\u7684\u56DE\u8C03\u540E\u53CD\u9988\u5B8C\u6210\u7684\u63D0\u793A\u3002 <img src="'+r+'" alt=""></p><h2 id="\u52A8\u753B" tabindex="-1">\u52A8\u753B <a class="header-anchor" href="#\u52A8\u753B" aria-hidden="true">#</a></h2><p>\u6307\u6807\uFF1A\u5728\u5C55\u793A\u52A8\u753B\u7684\u65F6\u5019\uFF0C\u6BCF\u4E00\u5E27\u5E94\u8BE5\u4EE5 10ms \u8FDB\u884C\u6E32\u67D3\uFF0C\u8FD9\u6837\u53EF\u4EE5\u4FDD\u6301\u52A8\u753B\u6548\u679C\u7684\u4E00\u81F4\u6027\uFF0C\u5E76\u4E14\u907F\u514D\u5361\u987F\u3002</p><p>\u524D\u7AEF\u6240\u6D89\u53CA\u7684\u52A8\u753B\u4E0D\u4EC5\u6709\u70AB\u9177\u7684UI\u7279\u6548\uFF0C\u8FD8\u5305\u62EC\u6EDA\u52A8\u548C\u89E6\u6478\u62D6\u52A8\u7B49\u4EA4\u4E92\u6548\u679C\uFF0C\u800C\u8FD9\u4E00\u65B9\u9762\u7684\u6027\u80FD\u8981\u6C42\u5C31\u662F\u6D41\u7545\u3002\u4F17\u6240\u5468\u77E5\uFF0C\u4EBA\u773C\u5177\u6709\u89C6\u89C9\u6682\u7559\u7279\u6027\uFF0C\u5C31\u662F\u5F53\u5149\u5BF9\u89C6\u7F51\u819C\u6240\u4EA7\u751F\u7684\u89C6\u89C9\u5728\u5149\u505C\u6B62\u4F5C\u7528\u540E\uFF0C\u4ECD\u80FD\u4FDD\u7559\u4E00\u6BB5\u65F6\u95F4\u3002</p><p>\u7814\u7A76\u8868\u660E\u8FD9\u662F\u7531\u4E8E\u89C6\u795E\u7ECF\u5B58\u5728\u53CD\u5E94\u901F\u5EA6\u9020\u6210\u7684\uFF0C\u5176\u503C\u662F 1/24s\uFF0C\u5373\u5F53\u6211\u4EEC\u6240\u89C1\u7684\u7269\u4F53\u79FB\u9664\u540E\uFF0C\u8BE5\u7269\u4F53\u5728\u6211\u4EEC\u773C\u4E2D\u5E76\u4E0D\u4F1A\u7ACB\u5373\u6D88\u5931\uFF0C\u800C\u4F1A\u5EF6\u7EED\u5B58\u5728 1/24s \u7684\u65F6\u95F4\u3002\u5BF9\u52A8\u753B\u6765\u8BF4\uFF0C\u65E0\u8BBA\u52A8\u753B\u5E27\u7387\u6709\u591A\u9AD8\uFF0C\u6700\u540E\u6211\u4EEC\u4EC5\u80FD\u5206\u8FA8\u5176\u4E2D\u7684 30 \u5E27\uFF0C\u4F46\u8D8A\u9AD8\u7684\u5E27\u7387\u4F1A\u5E26\u6765\u66F4\u597D\u7684\u6D41\u7545\u4F53\u9A8C\uFF0C\u56E0\u6B64\u52A8\u753B\u8981\u5C3D\u529B\u8FBE\u5230 60fps \u7684\u5E27\u7387\u3002</p><p>\u76EE\u524D\u5927\u591A\u6570\u8BBE\u5907\u7684\u5C4F\u5E55\u5237\u65B0\u7387\u4E3A 60 \u6B21/\u79D2\uFF0C\u90A3\u4E48\u6D4F\u89C8\u5668\u6E32\u67D3\u52A8\u753B\u6216\u9875\u9762\u7684\u6BCF\u4E00\u5E27\u7684\u901F\u7387\u4E5F\u9700\u8981\u8DDF\u8BBE\u5907\u5C4F\u5E55\u7684\u5237\u65B0\u7387\u4FDD\u6301\u4E00\u81F4\u3002\u6240\u4EE5\u6839\u636E 60fps \u5E27\u7387\u7684\u8BA1\u7B97\uFF0C\u6BCF\u4E00\u5E27\u753B\u9762\u7684\u751F\u6210\u90FD\u9700\u8981\u7ECF\u8FC7\u82E5\u5E72\u6B65\u9AA4\uFF0C\u4E00\u5E27\u56FE\u50CF\u7684\u751F\u6210\u9884\u7B97\u4E3A 16ms\uFF081000ms / 60 \u2248 16.66ms\uFF09\uFF0C\u9664\u53BB\u6D4F\u89C8\u5668\u7ED8\u5236\u65B0\u5E27\u7684\u65F6\u95F4\uFF0C\u7559\u7ED9\u6267\u884C\u4EE3\u7801\u7684\u65F6\u95F4\u4EC5 10ms \u5DE6\u53F3\u3002\u5982\u679C\u65E0\u6CD5\u7B26\u5408\u6B64\u9884\u7B97\uFF0C\u5E27\u7387\u5C06\u4E0B\u964D\uFF0C\u5E76\u4E14\u5185\u5BB9\u4F1A\u5728\u5C4F\u5E55\u4E0A\u6296\u52A8\u3002 \u6B64\u73B0\u8C61\u901A\u5E38\u79F0\u4E3A\u5361\u987F\uFF0C\u4F1A\u5BF9\u7528\u6237\u4F53\u9A8C\u4EA7\u751F\u8D1F\u9762\u5F71\u54CD\u3002</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p><a href="https://googlechrome.github.io/devtools-samples/jank/" target="_blank" rel="noreferrer">https://googlechrome.github.io/devtools-samples/jank/</a></p></div><h2 id="\u7A7A\u95F2" tabindex="-1">\u7A7A\u95F2 <a class="header-anchor" href="#\u7A7A\u95F2" aria-hidden="true">#</a></h2><p>\u6307\u6807\uFF1A\u5F53\u4F7F\u7528 Javascript \u4E3B\u7EBF\u7A0B\u7684\u65F6\u5019\uFF0C\u5E94\u8BE5\u628A\u4EFB\u52A1\u5212\u5206\u5230\u6267\u884C\u65F6\u95F4\u5C0F\u4E8E 50ms \u7684\u7247\u6BB5\u4E2D\u53BB\uFF0C\u8FD9\u6837\u53EF\u4EE5\u91CA\u653E\u7EBF\u7A0B\u4EE5\u8FDB\u884C\u7528\u6237\u4EA4\u4E92\u3002</p><p>\u8981\u4F7F\u7F51\u7AD9\u54CD\u5E94\u8FC5\u901F\u3001\u52A8\u753B\u6D41\u7545\uFF0C\u901A\u5E38\u90FD\u9700\u8981\u8F83\u957F\u7684\u5904\u7406\u65F6\u95F4\uFF0C\u4F46\u4EE5\u7528\u6237\u4E3A\u4E2D\u5FC3\u6765\u770B\u5F85\u6027\u80FD\u95EE\u9898\uFF0C\u5C31\u4F1A\u53D1\u73B0\u5E76\u975E\u6240\u6709\u5DE5\u4F5C\u90FD\u9700\u8981\u5728\u54CD\u5E94\u548C\u52A0\u8F7D\u9636\u6BB5\u5B8C\u6210\uFF0C\u6211\u4EEC\u5B8C\u5168\u53EF\u4EE5\u5229\u7528\u6D4F\u89C8\u5668\u7684\u7A7A\u95F2\u65F6\u95F4\u5904\u7406\u53EF\u5EF6\u8FDF\u7684\u4EFB\u52A1\uFF0C\u53EA\u8981\u8BA9\u7528\u6237\u611F\u53D7\u4E0D\u5230\u5EF6\u8FDF\u5373\u53EF\u3002\u5229\u7528\u7A7A\u95F2\u65F6\u95F4\u5904\u7406\u5EF6\u8FDF\uFF0C\u53EF\u51CF\u5C11\u9884\u52A0\u8F7D\u7684\u6570\u636E\u5927\u5C0F\uFF0C\u4EE5\u4FDD\u8BC1\u7F51\u7AD9\u6216\u5E94\u7528\u5FEB\u901F\u5B8C\u6210\u52A0\u8F7D\u3002</p><p>\u4E3A\u4E86\u66F4\u52A0\u5408\u7406\u5730\u5229\u7528\u6D4F\u89C8\u5668\u7684\u7A7A\u95F2\u65F6\u95F4\uFF0C\u6700\u597D\u5C06\u5904\u7406\u4EFB\u52A1\u6309 50ms \u4E3A\u5355\u4F4D\u5206\u7EC4\u3002\u8FD9\u4E48\u505A\u5C31\u662F\u4FDD\u8BC1\u7528\u6237\u5728\u53D1\u751F\u64CD\u4F5C\u540E\u7684 100ms \u5185\u7ED9\u51FA\u54CD\u5E94\u3002</p><h2 id="\u52A0\u8F7D" tabindex="-1">\u52A0\u8F7D <a class="header-anchor" href="#\u52A0\u8F7D" aria-hidden="true">#</a></h2><p>\u6307\u6807\uFF1A\u9996\u6B21\u52A0\u8F7D\u5E94\u8BE5\u5728\u5C0F\u4E8E 5s \u7684\u65F6\u95F4\u5185\u52A0\u8F7D\u5B8C\u6210\uFF0C\u5E76\u53EF\u4EE5\u8FDB\u884C\u7528\u6237\u4EA4\u4E92\u3002\u5BF9\u4E8E\u540E\u7EED\u52A0\u8F7D\uFF0C\u5219\u662F\u5EFA\u8BAE\u57282\u79D2\u5185\u5B8C\u6210\u3002</p><p>\u7528\u6237\u611F\u77E5\u8981\u6C42\u6211\u4EEC\u5C3D\u91CF\u5728 5s \u5185\u5B8C\u6210\u9875\u9762\u52A0\u8F7D\uFF0C\u5982\u679C\u6CA1\u6709\u5B8C\u6210\uFF0C\u7528\u6237\u7684\u6CE8\u610F\u529B\u5C31\u4F1A\u5206\u6563\u5230\u5176\u4ED6\u4E8B\u60C5\u4E0A\uFF0C\u5E76\u5BF9\u5F53\u524D\u5904\u7406\u7684\u4EFB\u52A1\u4EA7\u751F\u4E2D\u65AD\u611F\u3002\u9700\u8981\u6CE8\u610F\u7684\u662F\uFF0C\u8FD9\u91CC\u5728 5s \u5185\u5B8C\u6210\u52A0\u8F7D\u5E76\u6E32\u67D3\u51FA\u9875\u9762\u7684\u8981\u6C42\uFF0C\u5E76\u975E\u8981\u5B8C\u6210\u6240\u6709\u9875\u9762\u8D44\u6E90\u7684\u52A0\u8F7D\uFF0C\u4ECE\u7528\u6237\u611F\u77E5\u4F53\u9A8C\u7684\u89D2\u5EA6\u6765\u8BF4\uFF0C\u53EA\u8981\u5173\u952E\u6E32\u67D3\u8DEF\u5F84\u5B8C\u6210\uFF0C\u7528\u6237\u5C31\u4F1A\u8BA4\u4E3A\u5168\u90E8\u52A0\u8F7D\u5DF2\u5B8C\u6210\u3002</p><p>\u5BF9\u4E8E\u5176\u4ED6\u975E\u5173\u952E\u8D44\u6E90\u7684\u52A0\u8F7D\uFF0C\u5EF6\u8FDF\u5230\u6D4F\u89C8\u5668\u7A7A\u95F2\u65F6\u6BB5\u518D\u8FDB\u884C\uFF0C\u662F\u6BD4\u8F83\u5E38\u89C1\u7684\u6E10\u8FDB\u5F0F\u4F18\u5316\u7B56\u7565\u3002\u6BD4\u5982\u56FE\u7247\u61D2\u52A0\u8F7D\u3001\u4EE3\u7801\u62C6\u5206\u7B49\u4F18\u5316\u624B\u6BB5\u3002</p>',28),p=[l];function o(n,c,h,m,_,u){return a(),e("div",null,p)}const b=t(d,[["render",o]]);export{g as __pageData,b as default};
